import * as tf from "@tensorflow/tfjs";

const CONTROLS = ["a", "b", "c", "d"];

export function init() {
  document.getElementById("controller").style.display = "";
  statusElement.style.display = "none";
}

const trainStatusElement = document.getElementById("train-status");

// Set hyper params from UI values.
const learningRateElement = document.getElementById("learningRate");
export const getLearningRate = () => +learningRateElement.value;

const batchSizeFractionElement = document.getElementById("batchSizeFraction");
export const getBatchSizeFraction = () => +batchSizeFractionElement.value;

const epochsElement = document.getElementById("epochs");
export const getEpochs = () => +epochsElement.value;

const denseUnitsElement = document.getElementById("dense-units");
export const getDenseUnits = () => +denseUnitsElement.value;
const statusElement = document.getElementById("status");

export function isPredicting() {
  statusElement.style.visibility = "visible";
}

export function predictClass(classId) {
  document.body.setAttribute("data-active", CONTROLS[classId]);
}

export function donePredicting() {
  statusElement.style.visibility = "hidden";
}
export function trainStatus(status) {
  trainStatusElement.innerText = status;
}

export let addExampleHandler;
export function setExampleHandler(handler) {
  addExampleHandler = handler;
}
let mouseDown = false;
const totals = [0, 0, 0, 0];

const aButton = document.getElementById("a");
const bButton = document.getElementById("b");
const cButton = document.getElementById("c");
const dButton = document.getElementById("d");

const thumbDisplayed = {};

const step = document.querySelector(".step").querySelector("span");

async function handler(label) {
  if (step.innerText == 1) {
    mouseDown = true;
    const className = CONTROLS[label];
    const button = document.getElementById(className);
    const total = document.getElementById(className + "-total");
    while (mouseDown) {
      addExampleHandler(label);
      document.body.setAttribute("data-active", CONTROLS[label]);
      total.innerText = ++totals[label];
      await tf.nextFrame();
    }
    document.body.removeAttribute("data-active");
  }
}

aButton.addEventListener("mousedown", () => handler(0));
aButton.addEventListener("mouseup", () => (mouseDown = false));

bButton.addEventListener("mousedown", () => handler(1));
bButton.addEventListener("mouseup", () => (mouseDown = false));

cButton.addEventListener("mousedown", () => handler(2));
cButton.addEventListener("mouseup", () => (mouseDown = false));

dButton.addEventListener("mousedown", () => handler(3));
dButton.addEventListener("mouseup", () => (mouseDown = false));

export function drawThumb(img, label) {
  if (thumbDisplayed[label] == null) {
    const thumbCanvas = document.getElementById(CONTROLS[label] + "-thumb");
    draw(img, thumbCanvas);
  }
}

export function draw(image, canvas) {
  const [width, height] = [224, 224];
  const ctx = canvas.getContext("2d");
  const imageData = new ImageData(width, height);
  const data = image.dataSync();
  for (let i = 0; i < height * width; ++i) {
    const j = i * 4;
    imageData.data[j + 0] = (data[i * 3 + 0] + 1) * 127;
    imageData.data[j + 1] = (data[i * 3 + 1] + 1) * 127;
    imageData.data[j + 2] = (data[i * 3 + 2] + 1) * 127;
    imageData.data[j + 3] = 255;
  }
  ctx.putImageData(imageData, 0, 0);
}
